        <script type="text/javascript">
            function makeSchoolFriendlyName(fullname){
                var result = fullname
                    .replace('Государственное бюджетное общеобразовательное учреждение города Севастополя', '')
                    .replace('Государственное бюджетное образовательное учреждение города Севастополя', '')
                    .replace('Средняя общеобразовательная школа', 'СОШ');
                var nameLenght = 50;
                return result.length > nameLenght? result.substring(1, nameLenght) + '...' : result; 
            }
            $(document).ready(function() {
                var schools = _.uniqBy(_.map(jsonData.data, function(row){
                    return {'id': row.school_id, 'title': row.school}
                }),'id');
                //https://stackoverflow.com/questions/25047463/group-by-and-sum-using-underscore-lodash/56746267
                var statistics_grouped = _(jsonData.data).groupBy('school_id')
                    .map(function(data, school_id){
                        return {
                            'actual': _.meanBy(data, function(d) { return parseInt(d.actual); }),
                            'expected': _.meanBy(data, function(d) { return parseInt(d.expected); })
                        }
                    })
                    .value();
            
                //https://jsfiddle.net/gh/get/library/pure/highcharts/highcharts/tree/master/samples/highcharts/demo/column-basic          
                Highcharts.chart('container', {
                    chart: {
                        type: 'column'
                    },
                    title: {
                        text: 'Статистика загруженности школ г. Севастополя - все классы'
                    },
                    xAxis: {
                        categories:_.map(schools, function(s){return makeSchoolFriendlyName(s.title)}),
                        crosshair: true
                    },
                    yAxis: {
                        min: 0,
                        title: {
                            text: 'Количество учеников'
                        }
                    },
                    
                    tooltip: {
                        headerFormat: '<span style="font-size:10px">{point.key}</span><table>',
                        pointFormat: '<tr><td style="color:{series.color};padding:0">{series.name}: </td>' +
                            '<td style="padding:0"><b>{point.y:.1f}</b></td></tr>',
                        footerFormat: '</table>',
                        shared: true,
                        useHTML: true
                    },
                    plotOptions: {
                        column: {
                            pointPadding: 0.2,
                            borderWidth: 0
                        }
                    },
                    series: [{
                            name: 'Норма',
                            data: _.map(statistics_grouped, 'expected')
                        },
                        {
                            name: 'Фактическое количество',
                            data: _.map(statistics_grouped, 'actual')
                        },
                        {
                            name: 'Переполнение',
                            data: _.map(statistics_grouped, function(d){return d.actual - d.expected})
                        },
                    ]
                });
            
            });
